		 -o-transition: all .400s;
			transition: all .400s;
}
.btn-translucid:hover {
	color:#fff;
	background-color:rgba(0,0,0,0.2);
}

/* 3D Buttons */
.btn-3d {
	border-bottom: 3px solid rgba(0,0,0,.15);
}
	.btn-3d:hover {
	  opacity: 0.9;
	  filter: alpha(opacity=90);
	}
	.btn-3d.btn-link {
		border-bottom:0;
	}

/* Extra Large Buttons */
	.btn-xlg {
		padding: 24px 34px;
	}

/* Button reveal */
.btn.btn-reveal {
    padding-left:28px;
    padding-right:28px;
    overflow: hidden;
	position:relative;
}

.btn.btn-reveal i {
    display: block;
    position: absolute;
    left: -32px;
    width: 32px;
    top: 0;
	bottom:0;
    margin: 0;
	padding:0;
	font-size:17px;
	line-height:34px;
    text-align: center;
    background-color: rgba(0,0,0,0.1);
}
.btn.btn-reveal span {
    display: inline-block;
    position: relative;
    left: 0;
}
body:not(.device-touch) .btn.btn-reveal i,
body:not(.device-touch) .btn.btn-reveal span {
    -webkit-transition: left 0.3s ease, right 0.3s ease;
		 -o-transition: left 0.3s ease, right 0.3s ease;
			transition: left 0.3s ease, right 0.3s ease;
}

	/* extra small */
	.btn.btn-reveal.btn-xs { 
		padding: 0 17px; 
	}
	.btn.btn-reveal.btn-xs i {
		left: -22px;
		width: 22px;
		height: 28px;
		line-height: 20px;
		font-size:12px;
	}
	/* small */
	.btn.btn-reveal.btn-sm { 
		padding-left: 22px; 
		padding-right: 22px; 
	}
	.btn.btn-reveal.btn-sm i {
		left: -26px;
		width: 26px;
		height: 34px;
		line-height: 28px;
		font-size:14px;
	}
	/* large */
	.btn.btn-reveal.btn-lg { 
		padding-left:32px; 
		padding-right:32px; 
	}
	.btn.btn-reveal.btn-lg i {
		left: -38px;
		width: 38px;
		height: 46px;
		line-height: 46px;
	}
	/* extra large */
	.btn.btn-reveal.btn-xlg { 
		padding-left:40px; 
		padding-right:40px; 
	}
	.btn.btn-reveal.btn-xlg i {
		left: -44px;
		width: 44px;
		height: 72px;
		line-height: 72px;
		font-size:20px;
	}

.btn.btn-reveal:hover i { 
	left: 0; 
}
.btn.btn-reveal:hover span { 
	left: 16px; 
}


