	display:block;

	webkit-transition: all .2s ease-in-out;
	transition: all .2s ease-in-out;
}
.owl-carousel.featured .owl-featured-item:hover {
	background-color: #eaeaea;
}
.owl-carousel.featured .owl-featured-item a.figure {
	margin:0; padding:0;
	display:block;
	width:100%;
	height:auto;
	overflow:hidden;
	text-align:center;
	z-index:0;
